<div class="panel panel-default" style="margin-top:15px">
<table class="table table-hover">
    <th>{{vm.rows.columns[0]}}</th>
    <th>{{vm.rows.columns[1]}}</th>
    <th>{{vm.rows.columns[2]}}</th>

    <tr ng-repeat="row in vm.rows.rows">
        <td>{{row[0]}}</td>
        <td>{{row[1]}}</td>
        <td>{{row[2]}}</td>
    </tr>
</table>
</div>
